    visibility: visible;
    opacity: 1;
    width: 100%;
    height: 100%;
    object-fit: cover;

    @supports (-ms-ime-align:auto) {
      object-fit: none;
      margin: none;
      position: inherit;
      z-index: 1;
      top: 50%;
      left: 0%;
