        justify-content: center;
        width: 40px;
        height: 40px;
        background-color: #e5e5e5;
        border-radius: 50%;
        font-size: 1.375rem;
        line-height: 1;
        margin: 0.25rem;
        padding: 0.5rem;
        color: $black;

        &:hover,
        &:focus {
          text-decoration: none;
        }

        &.current {
          color: $white;
          background-color: $brand-1;
        }

        &.next,
        &.prev {
          background-color: transparent;
          position: relative;
          width: auto;
          color: $brand-2;
          font-style: italic;
          font-weight: 700;
          text-transform: lowercase;
